import "./Images.css"
import {ReactComponent as InputSvg} from "./userData/input.svg";
import {ReactComponent as OutputSvg} from "./userData/output.svg";
import {ReactComponent as LogoSvg} from "./logo.svg";

export default function Images(props) {
    const {userInputProcessed} = props;

    const onFileChange = event => { 
        // Update the state 
        this.setState({ selectedFile: event.target.files[0] }); 
    }; 

    return (
        <div className="Images">
            <div className="Images-input" onClick={this.onFileUpload}>
                <input type="file" onChange={this.onFileChange} />
                {userInputProcessed? <InputSvg /> : <LogoSvg />}
            </div>
            <div className="Images-output">
                {userInputProcessed? <OutputSvg /> : <LogoSvg />}
            </div>
        </div>
    );
}
